  const [results, setResults] = useState([]);

  return (
    <div className="App">
      <Header />
      <Description />
      <div className="search-bar-container">
        <SearchBar setResults={setResults} />
        <SearchResults results={results}/>
      </div>

    </div>
  );
}

export default App;
